// ENQUIRY MODALS
// =====================================================
 function raiseModal( query ){
     if (query == 4) {
         $('.extra-modal-2').fadeIn('fast');
     } else {
         $('.extra-modal').fadeIn('fast');
     }
     jQuery('.modal-heading').html( dataStore( query ).heading )
     jQuery('.modal-data').html( dataStore( query ).data )
 }
 function sinkModal(mode){
     if (mode == 1) {
         $('.extra-modal').fadeOut('fast');
     } else {
         $('.extra-modal-2').fadeOut('fast');
     }
     clearinput();
 }

 function dataStore( id ){
     var data = [{
         id: 1,
         type: ' Web Marketing Services ',
         heading: '<span class="secondary_text">Web Marketing Services from </span><span style="font-family: Magneto; color: #778899">Hardscrabble</span>',
         data:   ' <p class="tertiary_text">Website Design <br>'+

                 ' Web Communications (emails and push notifications) <br>'+
                 ' Campaign Monitoring and Analytics <br>'+
                 ' Customer Engagement and Transaction Platforms  <br>'+
                 ' eCommerce Platforms  <br>'+
                 ' Social Media Setup <br><br></p> '+

                 'If you don\'t see what your looking for here, we happily discuss that as well '
     },{
         id: 2,
         type: ' Email Marketing Services ',
         heading: '<span class="secondary_text">Email Marketing Services from </span><span style="font-family: Magneto; color: #778899">Hardscrabble</span>',
         data: ' <p class="tertiary_text"> Transactional Emails<br>'+
                 ' Promotional Campaigns <br>'+
                 ' Email Template Design <br>'+
                 ' Campaign Monitoring and Analytics <br>'+
                 ' Email Newsletters <br><br></p>' +

                 ' Please note this service is not suited for cold emailing. '
     },{
         id: 3,
         type: ' Application Development Services ',
         heading: '<span class="secondary_text">Application Development Services from </span><span style="font-family: Magneto; color: #778899">Hardscrabble</span>',
         data: ' <p class="tertiary_text"> Desktop Apps <br>'+
                 ' Web Apps <br>'+
                 ' Cloud Hosted Apps <br>'+
                 ' Mobile Apps<br></p>'
     },{
         id: 4,
         type: ' Support Query',
         heading: '<span style="font-family: Magneto; color: #778899">Hardscrabble Support</span> <span class="secondary_text">Here for you, always.</span>',
         data: ' <p class="tertiary_text"> Desktop Apps <br>'+
                 ' Web Apps <br>'+
                 ' Cloud Hosted Apps <br>'+
                 ' Mobile Apps<br></p>'
     }]

     for (var i = 0; i < data.length; i++) {
         if (data[i].id === parseInt(id)) {
           document.getElementById('hdn_package').value =  data[i].type;
           return data[i];
         }
     }
 }

 function clearinput(){
     var elem = document.getElementsByTagName('input')
     for (var i = 0; i < elem.length; i++) {
         if (elem[i].checked) {
             elem[i].checked = false;
         }
         if (elem[i].value != "") {
             elem[i].value = ""
         }
     }

     var txtarea = document.getElementsByTagName('textarea');
     for (var i = 0; i < txtarea.length; i++) {
         if (txtarea[i].value != "") {
             txtarea[i].value = ""
         }
     }
 }

